import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider } from '@mui/material/styles';
import { CssBaseline, CircularProgress, Box } from '@mui/material';
import { Provider } from 'react-redux';
import { PersistGate } from 'redux-persist/integration/react';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import { store, persistor } from './store';
import theme from './theme/theme';
import Layout from './components/layout/Layout';
import CartSidebar from './components/cart/CartSidebar';

// Import pages
import HomePage from './pages/HomePage';

// Protected Route component
import ProtectedRoute from './components/auth/ProtectedRoute';

// Loading component
const LoadingSpinner = () => (
  <Box sx={{ 
    display: 'flex', 
    justifyContent: 'center', 
    alignItems: 'center', 
    height: '100vh',
    flexDirection: 'column',
    gap: 2
  }}>
    <CircularProgress size={60} />
    <div>Loading FoodieExpress...</div>
  </Box>
);

function App() {
  return (
    <Provider store={store}>
      <PersistGate loading={<LoadingSpinner />} persistor={persistor}>
        <ThemeProvider theme={theme}>
          <CssBaseline />
          <Router>
            <Layout>
              <Routes>
                {/* Public Routes */}
                <Route path="/" element={<HomePage />} />
                
                {/* Temporary placeholder routes */}
                <Route path="/restaurants" element={<div>Restaurants Page - Coming Soon</div>} />
                <Route path="/restaurant/:id" element={<div>Restaurant Details - Coming Soon</div>} />
                <Route path="/login" element={<div>Login Page - Coming Soon</div>} />
                <Route path="/register" element={<div>Register Page - Coming Soon</div>} />
                
                {/* Protected Routes - Customer */}
                <Route 
                  path="/checkout" 
                  element={
                    <ProtectedRoute roles={['CUSTOMER']}>
                      <div>Checkout Page - Coming Soon</div>
                    </ProtectedRoute>
                  } 
                />
                <Route 
                  path="/orders" 
                  element={
                    <ProtectedRoute roles={['CUSTOMER']}>
                      <div>Orders Page - Coming Soon</div>
                    </ProtectedRoute>
                  } 
                />
                <Route 
                  path="/profile" 
                  element={
                    <ProtectedRoute>
                      <div>Profile Page - Coming Soon</div>
                    </ProtectedRoute>
                  } 
                />
                
                {/* Dashboard Routes */}
                <Route 
                  path="/restaurant-dashboard/*" 
                  element={
                    <ProtectedRoute roles={['RESTAURANT_OWNER']}>
                      <div>Restaurant Dashboard - Coming Soon</div>
                    </ProtectedRoute>
                  } 
                />
                
                <Route 
                  path="/delivery-dashboard/*" 
                  element={
                    <ProtectedRoute roles={['DELIVERY_PARTNER']}>
                      <div>Delivery Dashboard - Coming Soon</div>
                    </ProtectedRoute>
                  } 
                />
                
                <Route 
                  path="/admin/*" 
                  element={
                    <ProtectedRoute roles={['ADMIN']}>
                      <div>Admin Dashboard - Coming Soon</div>
                    </ProtectedRoute>
                  } 
                />

                {/* Fallback Route */}
                <Route path="*" element={
                  <Box sx={{ 
                    padding: '2rem', 
                    textAlign: 'center',
                    minHeight: '50vh',
                    display: 'flex',
                    flexDirection: 'column',
                    justifyContent: 'center',
                    alignItems: 'center'
                  }}>
                    <h2>404 - Page Not Found</h2>
                    <p>The page you're looking for doesn't exist.</p>
                  </Box>
                } />
              </Routes>
              
              {/* Global Components */}
              <CartSidebar />
              
              {/* Toast Notifications */}
              <ToastContainer
                position="top-right"
                autoClose={5000}
                hideProgressBar={false}
                newestOnTop={false}
                closeOnClick
                rtl={false}
                pauseOnFocusLoss
                draggable
                pauseOnHover
                theme="light"
              />
            </Layout>
          </Router>
        </ThemeProvider>
      </PersistGate>
    </Provider>
  );
}

export default App;
